const recognizeButton = document.querySelector('#recognize')

const first = document.getElementById('first-number')
const second = document.getElementById('second-number')
const third = document.getElementById('third-number')

recognizeButton.onclick = () => {
   const input = []
   for (let div of divs) {
      input.push(div.className === 'active' ? 1 : 0)
   }  

   const numbers = predict(input)

   first.textContent = numbers[0][0]
   second.textContent = numbers[0][1]
   third.textContent = numbers[0][2]
}